INSERT INTO public.product_ VALUES (1, 'Muay thai ou boxe tailandês, é uma arte marcial originária da Tailândia, onde é considerado desporto nacional', true, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dapibus efficitur blandit. Integer hendrerit egestas felis, et tristique nisl euismod a. Proin fringilla lobortis tellus, vel eleifend quam facilisis sed. Pellentesque id efficitur urna.', 'MUAY-THAI', 'https://www.bravusclub.com.br/img/faq-mulher-chutando-muay-thay.jpg', 1);
INSERT INTO public.product_ VALUES (2, 'O boxe ou pugilismo é um esporte de combate, no qual os lutadores usam apenas os punhos, tanto para a defesa, quanto para o ataque.', true, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dapibus efficitur blandit. Integer hendrerit egestas felis, et tristique nisl euismod a. Proin fringilla lobortis tellus, vel eleifend quam facilisis sed. Pellentesque id efficitur urna.', 'BOXE', 'https://image.freepik.com/free-photo/boxer-with-black-gloves-training-close-up_23-2148416712.jpg', 1);
INSERT INTO public.product_ VALUES (3, 'Jujutsu, mais conhecido na sua forma ocidentalizada Jiu-jitsu, ju-jitsu, é uma arte marcial japonesa, e também um esporte de combate, que utiliza técnicas de golpes de alavancas, torções e pressões para derrubar e dominar um oponente .', true, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dapibus efficitur blandit. Integer hendrerit egestas felis, et tristique nisl euismod a. Proin fringilla lobortis tellus, vel eleifend quam facilisis sed. Pellentesque id efficitur urna.', 'JIU-JITSU', 'https://cdn.shopify.com/s/files/1/2776/7470/articles/jiujitsu_1024x1024.jpg', 1);
INSERT INTO public.product_ VALUES (4, 'Caraté ou karaté ou Caratê ou caratê-dô é uma arte marcial japonesa desenvolvida a partir da arte marcial indígena de Okinawa sob influência da arte da guerra chinesa, das lutas tradicionais japonesas e das disciplinas guerreiras japonesas.', true, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dapibus efficitur blandit. Integer hendrerit egestas felis, et tristique nisl euismod a. Proin fringilla lobortis tellus, vel eleifend quam facilisis sed. Pellentesque id efficitur urna.', 'KARATE', 'https://media.istockphoto.com/photos/martial-arts-fighter-picture-id1139651255?k=6&m=1139651255&s=612x612&w=0&h=G-YTxaYO5TU-eqJGxHJ4a1sDEBvSRwzQAytf9ePODLQ=', 1);
INSERT INTO public.product_ VALUES (5, 'As artes marciais mistas, ou do inglês MMA, são uma modalidade de esporte de combate que incluem tanto golpes de combate em pé quanto técnicas de luta no chão.', true, 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque dapibus efficitur blandit. Integer hendrerit egestas felis, et tristique nisl euismod a. Proin fringilla lobortis tellus, vel eleifend quam facilisis sed. Pellentesque id efficitur urna.', 'MMA', 'https://i.ytimg.com/vi/cz__-sP9p4g/hqdefault.jpg', 1);
